    render() {
        return(
            <div>
            <div className = "armourSlot" style={{top:'20%', left:'12%'}}/>
            <div className = "armourSlot" style={{top:'40%', left:'12%'}}/>
            <div className = "armourSlot" style={{top:'40%', left:'2%'}}/>
            <div className = "armourSlot" style={{top:'40%', left:'22%'}}/>
